    "Endorse this resource and give the reason why you do that.": "\u0c08 \u0c35\u0c28\u0c30\u0c41\u0c28\u0c41 \u0c06\u0c2e\u0c4b\u0c26\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c2e\u0c40\u0c30\u0c41 \u0c0e\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c05\u0c32\u0c3e \u0c1a\u0c47\u0c38\u0c4d\u0c24\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c4b \u0c15\u0c3e\u0c30\u0c23\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c24\u0c46\u0c32\u0c3f\u0c2f\u0c1c\u0c47\u0c2f\u0c02\u0c21\u0c3f.",
