    "Entering import resource mode": "\u0c26\u0c3f\u0c17\u0c41\u0c2e\u0c24\u0c3f \u0c30\u0c3f\u0c38\u0c4b\u0c30\u0c4d\u0c38\u0c4d \u0c2e\u0c4b\u0c21\u0c4d\u200c\u0c32\u0c4b\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c35\u0c47\u0c36\u0c3f\u0c38\u0c4d\u0c24\u0c4b\u0c02\u0c26\u0c3f",
